  newt.flatten!

  orig = str.chars
  orig.map! do |char|
    if char =~ /[0-9]/
      newt.shift
    else
      char
    end
  end
  orig.join.length
end

def rearrange2(str)
  punc = {}
  nums = str.scan(/[0-9]/).join
  nums = nums[0] + nums[1...-1].chars.sort.join + nums[-1]

  str.chars.each_with_index do |char, idx|
    if char =~ /[[^0-9]]/
      punc[idx] = char
    end
  end

  punc.each do |k, v|
    nums.insert(k, v)
  end
  nums.length
end

